تلتزم فيتنس ستورم بحماية خصوصيتك وتأخذ مسؤوليتها فيما يتعلق بأمان معلومات العملاء على محمل الجد. يحدد بيان خصوصية التطبيق الخاص بنا المعلومات التي نجمعها وكيف نجمعها وماذا نفعل بها وكيف نحمي هذه المعلومات.

جمع البيانات الشخصية
المعلومات التي تقدمها لنا عند التسجيل في فيتنس ستورم:
● الاسم الكامل وعنوان البريد الإلكتروني
● الجنس وتاريخ الميلاد
● هدف اللياقة البدنية
● الطول والوزن
● عنوان IP ومعلومات المتصفح
● بطاقة الائتمان / الخصم أو تفاصيل الدفع الأخرى
● صورة الملف الشخصي للحساب
 وأي معلومات أخرى ضرورية لنا لتقديم خدماتنا.

المعلومات التي نجمعها تلقائيا: 
● نقوم بجمع معلومات عنك وعن استخدامك للتطبيق مثل التاريخ والوقت ، 
● الجهاز / الكمبيوتر ونظام التشغيل
● نوع المتصفح
● الصفحات التي تمت زيارتها وإجراءاتك على التطبيق وسجل المشاهدة واختيارات التمرين.
● معلومات حول اشتراكاتك مثل حالة الاشتراك وتاريخ الشراء والصلاحية والإلغاء
● خصائص الجهاز والبرامج
● معلومات الاتصال
● معلومات سجل المتصفح وخادم الويب القياسي

استخدام البيانات الشخصية
نستخدم بياناتك لتزويدك بأكثر جلسات التمارين / برامج اللياقة البدنية الموصى بها والتي تناسب نشاطك البدني وهدف اللياقة البدنية.  قد نستخدم أيضا تفاصيل الاتصال الخاصة بك للاتصال بك والحصول على ملاحظاتك على تطبيقنا وإذا كان لديك أي توصيات. 
لتحسين كفاءة التطبيق ؛ قد يتم استخدام بعض البيانات للتحليل الإحصائي والتسويقي ، واختبار الأنظمة ، واستطلاعات العملاء ، واتصالات علاقات العملاء ، وتقديم الخدمات والمنتجات التي نعتقد أنها قد تهمك.
للأسئلة حول استخدامنا لمعلوماتك الشخصية (بما في ذلك الأسس القانونية وآليات النقل التي نعتمد عليها) أو ملفات تعريف الارتباط أو التقنيات المماثلة ، يرجى الاتصال بمسؤول حماية البيانات / مكتب الخصوصية لدينا عبر البريد الإلكتروني المقدم في التطبيق.

مشاركة معلومات عنك
نحن نتبع إجراءات أمنية صارمة في تخزين معلومات المستخدم والكشف عنها.

ومع ذلك ، قد نشارك بياناتك الشخصية لأغراض قانونية والحماية والسلامة والامتثال للقوانين. ويشمل ذلك تبادل المعلومات مع الشركات والمؤسسات الأخرى للحماية من الاحتيال.
أيضا ، قد نشارك بياناتك مع خبرائنا لتحسين تجربة المستخدم وكفاءة التطبيق.

قد يتم تغيير سياسات التطبيق أو تحديثها من حين لآخر لتلبية المتطلبات والمعايير. لذلك ، يتم تشجيع المستخدمين على زيارة هذا القسم بشكل متكرر ليتم تحديثهم بشأن التغييرات التي تطرأ على التطبيق. ستكون التعديلات سارية المفعول في يوم نشرها.

