Fitness Storm هو تطبيق ديناميكي يتيح للمستخدمين التدريب مع مدربين من الطراز العالمي من خلال مقاطع الفيديو التعليمية عالية الدقة والتفصيلية.

وصف الخدمة
هذا التطبيق هو عمل تجاري مسجل في المملكة العربية السعودية. يتيح Fitness Storm للمستخدمين التدريب مع مدربين من الطراز العالمي من خلال مقاطع الفيديو التعليمية عالية الدقة والتفصيلية ويساعدهم على الحصول على شكل الجسم الذي حلموا به دائمًا.

استخدام هذا التطبيق
يخضع استخدامك لهذا التطبيق لقبولك اللا رجعة فيه دون تعديل لهذه الشروط والأحكام (الشروط) وأنت توافق على استخدام هذا التطبيق بما يتوافق مع هذه الشروط. تشكل الشروط المنصوص عليها هنا الاتفاق الكامل بينك وبين Fitness Storm. إذا لم تقرأ أو توافق على هذه الشروط، فلا تستخدم هذا التطبيق. من خلال الوصول إلى أي جزء من تطبيق Fitness Storm، فإنك توافق على الالتزام بهذه الشروط. تعهدك بألا تستخدم هذا التطبيق لأي غرض غير قانوني أو محظور بموجب هذه الشروط كشرط لاستخدام هذا التطبيق.

معلومات هامة
العملاء الذين يستخدمون التطبيق وهم قاصرين/تحت سن 18 عامًا لا يجب أن يسجلوا كمستخدمين للتطبيق ولا يجوز لهم التعامل على التطبيق أو استخدامه إلا تحت إشراف ذويهم.
يجب على حامل البطاقة الاحتفاظ بنسخة من سجلات المعاملات وسياسات التاجر والقواعد.
أنت مسؤول عن الحفاظ على سرية حسابك.
يجب ألا تشارك معلومات حسابك مع أي شخص آخر.
تحتفظ الشركة المطورة بالحق في إلغاء حسابك في حالة اكتشاف أي استخدام غير لائق للتطبيق.
أنت مسؤول عن إدخال معلوماتك بشكل صحيح عند التسجيل لتوفير تمارين مناسبة تتناسب مع مستوى نشاطك. حيث نقدم تمارين للمبتدئين والمتوسطين والمحترفين.
يتحمل المستخدمون مسؤولية اختيار المدرب والتمارين المناسبة لاحتياجاتهم. لانتحمل المسؤولية عن أي إصابة أو ضرر قد يحدث أثناء التمرين أو أداء تمارين غير مناسبة.
يستهدف Fitness Storm الأفراد الأصحاء بما فيه الكفاية لأداء أنواع مختلفة من التمارين. في حال كنت تعاني من أي إصابات أو حالات صحية معينة، تأكد من استشارة الطبيب قبل التسجيل في تطبيقنا.
إذا كنت حاملاً أو ترضعين، تأكدي من موافقة الطبيب بشكل خاص على استخدامك للتطبيق.

الشروط والأحكام الخاصة بالتدريب الشخصي:

لا يمكن استرداد جلسات التدريب الشخصي، ويجب الالتزام بتواريخ بدء وانتهاء الجلسات.
قد تنشأ ظروف طارئة تؤدي إلى إعادة جدولة الجلسات، في هذه الحالة سيتم تطبيق السياسة التالية:
إذا اضطررت إلى إلغاء الجلسة في غضون 24 يومًا من تاريخ الحجز، سيتم تعويض الجلسة مجانًا.
في حالة إلغاء الجلسة في نفس اليوم، سيتم خصم الجلسة من الجلسات المتبقية.
تخضع جلسات التدريب الشخصي لفترة انتهاء الصلاحية تبلغ 30 يومًا من تاريخ المشاركة.
تتراوح مدة الجلسة بين 45 دقيقة إلى ساعة واحدة.
لا يمكن تسجيل الجلسة عبر الفيديو، حيث أنها تخضع للسرية بين المدرب والمتدرب.
لا يمكن تبادل الأرقام/البريد الإلكتروني بين المدرب والمتدرب، ويتم توفير الخدمة من خلال Fitness Storm.
يقتصر التأجيل على جلستين شهريًا.
يجب إبلاغ التأجيل قبل يوم واحد على الأقل من الجلسة، وإلا سيعتبر الجلسة ملغاة.
يجب تحديد موعد لتعويض الجلسة المؤجلة في غضون أسبوع ابتداءً من يوم التأجيل، أو يعتبر الجلسة ملغاة.
معالجة الدفع
نقبل المدفوعات من خلال الخيارات المتاحة في التطبيق بالريال السعودي أو الدولار الأمريكي.

تأكيد الدفع
بمجرد إجراء الدفع، سيتم إرسال إشعار التأكيد إلى العميل عبر البريد الإلكتروني في غضون 24 ساعة من استلام الدفع.

القانون الحاكم والاختصاص القضائي تخضع أي عملية شراء أو نزاع أو مطالبة تنشأ عن أو فيما يتعلق بهذا التطبيق وتفسر وفقا لقوانين المملكة العربية السعودية. 

قد يتم تغيير أو تحديث سياسات التطبيق والشروط والأحكام من حين لآخر لتلبية المتطلبات والمعايير. لذلك ، يتم تشجيع العملاء على زيارة هذه الأقسام بشكل متكرر حتى يتم تحديثهم بشأن التغييرات التي تطرأ على التطبيق. ستكون التعديلات سارية المفعول في يوم نشرها.
